function App() {

  return (
    <div className="App">
      <Route path="/" element={<Home />}/>
      <Route path="/" element={<About />}/>
      <Route path="/" element={<Settings />}/>
      <Route path="/" element={<Login />}/>
      <Route path="/" element={<Account />}/>
    </div>
  );
}

